import React, { Component } from 'react'
import Listitem from './Listem'

export default class List extends Component {
  render() {
    return (
      <div className="row">
        {
          this.props.users.isfirst ? <h2>Welcome to use, please enter the keyword</h2> :
            this.props.users.isloading ? <h2>Loading......</h2> :
              this.props.users.err ? <h2>{this.props.err}</h2> :
                this.props.users.map((a) => {

                  return (
                    <Listitem key={a.id} users={a} />
                  )


                })

        }
      </div>
    )
  }
}
